                genericErrorMsg = translatedMsgs[GENERIC_ERROR_MESSAGE];
                credentialsErrorMsg = translatedMsgs[CREDENTIALS_ERROR_MESSAGE];
                maxLengthErrorMsg = translatedMsgs[MAX_LENGTH_ERROR_MESSAGE];
